script: |
  super -f text -I q3403.spq | sort > q3403.out

inputs:
  - name: q3403.spq
    data: |
      SELECT ALL col1 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT - col0 + + - col1 NOT IN ( + col2, - col2 * - - col2, - col1, + + col0, 52 );
  - name: tab0

outputs:
  - name: q3403.out
    data: |
